// src/pages/Profile/Profile.jsx
import React, { useState } from "react";
import Button from "../../components/Button";

const Profile = () => {
  // Example state for user profile
  const [profile, setProfile] = useState({
    name: "Noshin Syara",
    email: "noshin@example.com",
    cleanliness: 7,
    sleep: 6,
    noise: 5,
  });

  const handleEdit = () => {
    alert("Edit profile functionality coming soon!");
  };

  return (
    <div className="max-w-3xl mx-auto p-6">
      <h1 className="text-3xl font-bold text-orange-500 mb-6">Your Profile</h1>

      <div className="bg-white rounded-xl shadow-md p-6 space-y-4">
        <div className="flex justify-between items-center">
          <h2 className="text-xl font-semibold">Personal Information</h2>
          <Button text="Edit" type="secondary" onClick={handleEdit} />
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <div>
            <p className="font-medium text-gray-700">Name</p>
            <p>{profile.name}</p>
          </div>
          <div>
            <p className="font-medium text-gray-700">Email</p>
            <p>{profile.email}</p>
          </div>
        </div>

        <h2 className="text-xl font-semibold mt-6">Preferences</h2>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-4 mt-2">
          <div className="bg-orange-50 p-4 rounded-lg text-center">
            <p className="font-medium text-gray-700">Cleanliness</p>
            <p>{profile.cleanliness}</p>
          </div>
          <div className="bg-orange-50 p-4 rounded-lg text-center">
            <p className="font-medium text-gray-700">Sleep</p>
            <p>{profile.sleep}</p>
          </div>
          <div className="bg-orange-50 p-4 rounded-lg text-center">
            <p className="font-medium text-gray-700">Noise Tolerance</p>
            <p>{profile.noise}</p>
          </div>
        </div>

        <div className="mt-6">
          <Button
            text="Save Preferences"
            type="primary"
            onClick={() => alert("Preferences saved!")}
          />
        </div>
      </div>
    </div>
  );
};

export default Profile;
